import React from "react";
import classes from "./Table.module.css";

const table = props => {
  console.log("size of the object", props.moveStats);
  console.log(props.moves);
  console.log("the data is data", props.moves);

  let moves = [];
  let data = [];
  let basePower = [];
  let duration = [];
  let energyDelta = [];
  let moveCooldown = [];


  for(let key in props.move)
  for (let key in props.moves) {
    console.log(key);
    console.log("ofund them", props.moveStats.data[key]);

    if (key === props.moveStats.data.key) {
      console.log("inside th if statemenet");
      moves.push(props.moveStats.data);
    }
    data.push(key);
  }

  console.log("the data is ", moves);
  basePower = moves.map(element => (
    <td key={Math.random()}>{element.quick_moves.base_power}</td>
  ));

  duration = moves.map(el => {
    console.log("printing el now", el);
    return <td key={Math.random()}>{el.quick_moves.duration}</td>;
  });

  energyDelta = moves.map(el => (
    <td key={Math.random()}> {el.quick_moves.energy_delta}</td>
  ));
  moveCooldown = moves.map(el => (
    <td key={Math.random()}>{el.quick_moves.move_cooldown}</td>
  ));

  return (
    <div className={classes.Table}>
      <table>
        <tr>
          <th key={Math.random()} style={{ textAlign: "left" }}>
            Stats
          </th>
          {data.map((el, index) => {
            return <th key={Math.random()}>{el} </th>;
          })}
        </tr>
        <tbody>
          <tr>
            <td key={Math.random()} style={{ textAlign: "left" }}>
              Base Power
            </td>
            {basePower}
          </tr>
          <tr>
            <td key={Math.random()} style={{ textAlign: "left" }}>
              Duration
            </td>
            {duration}
          </tr>
          <tr>
            <td key={Math.random()} style={{ textAlign: "left" }}>
              Energy Delta
            </td>
            {energyDelta}
          </tr>
          <tr>
            <td key={Math.random()} style={{ textAlign: "left" }}>
              Move Cooldown
            </td>
            {moveCooldown}
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default table;
